import styled from "styled-components";
import { useDispatch, useSelector } from "react-redux";
import { useEffect } from "react";
import { useHistory } from "react-router";
import { useTranslation } from "react-i18next";
import { unwrapResult } from "@reduxjs/toolkit";

import { ComponentHeaderAuth } from "@components";
import { lineLogin, lineSignup, logout, selectAuth, selectMerchant } from "@redux";
import { ModuleTel } from "@modules";
import {
    enumExternalAuthType,
    enumExternalMethod,
    LINE_AUTH_URL,
    PATH_SIGN_UP_EMAIL,
} from "@configs";
import { LineApi } from "@api";
import { useNotify } from "@utils";
import { ILineLogin, ILineSignup, ILineState } from "@interfaces";

export const PageSignUpTelFrom = () => {
    //page variable
    const merchant = useSelector(selectMerchant);
    const history = useHistory();
    const { error, success } = useNotify();
    const dispatch = useDispatch();
    const { t } = useTranslation();
    //page variable
    const { line, externalLogin } = useSelector(selectAuth);

    return (
        <StyledContainer color={merchant.themeColor}>
            <ComponentHeaderAuth />
            <ModuleTel />
        </StyledContainer>
    );
};

const StyledContainer = styled.div<{ color: string }>``;
